import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./components/Home";
import NavBar from "./components/NavBar";

const App = () => {
  return (
    <React.Fragment>
      <Router>
        <NavBar />
        <Route exact path="/" component={Home}></Route>
        <Home />
      </Router>
    </React.Fragment>
  );
};

export default App;
